import { Card } from 'react-bootstrap';

const CategoryLinks = () => {
  return (

    <div>
      <h1>Categories</h1>
      <Card.Body>
        <Card.Body>
          <Card.Title><h1>new1</h1></Card.Title>
          <Card.Text className="my-0"><strong>Author: </strong>new2</Card.Text>
          <Card.Text className="my-0"><strong>Published: </strong>new3</Card.Text>
        </Card.Body>
        <Card.Link href="#">Card Link</Card.Link>
        <Card.Link href="#">Another Link</Card.Link>
      </Card.Body>
    </div>
  )
}

export default CategoryLinks;
